import React, {Component} from 'react';
import './style.css';

class Draw extends Component{
  constructor() {
    super();
    this.state = {
      isDrawing: false,
      lines: Immutable.List(),
    };
  }

  render(){
    return(
      <div>
        <h1>Draw</h1>
        <div ref="drawArea" onMouseDown={this.handleMouseDown} />
      </div>
    )
  }
}
export default Draw;
